import Header from './Header'
import {useEffect} from 'react'

function Login(){
    
    useEffect(()=>{
        if(localStorage.getItem('user-info'))
        {
            history.push("/add")
        }
    }
    )
    return (
        <div>
        <Header />
            <h1>Login Page</h1>
        </div>
    )
}
export default Login;
